리뷰:
너무너무 맛있게 잘 먹었습니다. 예전에 식당에서 밥과 반찬 리필해 먹고, 배 부른데도 고기 추가해서 먹었던 그때처럼 행복한 식사시간 이었습니다.

저희는 맛있는 음식을 그토록 배부르게 자알 먹었지만 누군가 분명 손해를 입으셨을 거라 생각하면 마음이 편치는 않았습니다. 그런데 요기요에서까지 전화가 와서 정말 깜짝 놀랐네요. 복잡해질까봐 요기요 통하지않고 바로 전화드렸던건데...ㅡㅡ;;

여튼, 배달에 우여곡절이 있었습니다만, 덕분에(?) 저희는 포식을 했네요. 그래서 배달점수도 만점을...하하^^;;;

조금 비싼것 같지만  깨알문구 같은 센스 굳
밑반찬이라해봐야 콩나물이랑 무채인데  콩나물이 굳;;;
음식도 깔끔하고 배달도 빠르게 좋습니다.
